import { useState, useEffect } from 'react';

function TopBar() {
  const [isMobile, setIsMobile] = useState(false);
  const [isMenuOpen, setIsMenuOpen] = useState(false);
  
  // Check if we're on mobile
  useEffect(() => {
    const checkMobile = () => {
      setIsMobile(window.innerWidth <= 768);
    };
    
    // Check on initial load
    checkMobile();
    
    // Add resize listener
    window.addEventListener('resize', checkMobile);
    
    // Clean up
    return () => window.removeEventListener('resize', checkMobile);
  }, []);
  
  return (
    <>
      <div>
        <div
          className="background-color-darkcyan"
          style={{
            display: "flex",
            justifyContent: "space-between",
            paddingLeft: "50px",
            position: "relative"
          }}
        >
          <div
            style={{
              display: "flex",
              flexDirection: "column",
              alignItems: "center",
            }}
          >
            <h2 className="muwatana-title-styling" style={{ marginTop: "5px" }}>
              muwatana
            </h2>
            <small style={{ marginBottom: "20px" }}>
              learn to navigate the digital world safely
            </small>
          </div>
          
          {/* Mobile menu toggle - only visible on mobile */}
          {isMobile && (
            <div 
              style={{
                position: "absolute",
                top: "15px",
                right: "15px",
                fontSize: "2rem",
                cursor: "pointer",
                zIndex: 2000
              }}
              onClick={() => setIsMenuOpen(!isMenuOpen)}
            >
              🍔
            </div>
          )}
          
          {/* Original navigation - hidden on mobile */}
          <div className="navigation-tab-links" style={{ display: isMobile ? 'none' : 'flex' }}>
            <p>
              <a
                href="https://en.wikipedia.org/wiki/Main_Page"
                className="nav-link"
                style={{ margin: "10px" }}
              >
                About
              </a>
            </p>
            <p>
              <a
                href="https://en.wikipedia.org/wiki/Main_Page"
                className="nav-link"
                style={{ margin: "10px" }}
              >
                Resources
              </a>
            </p>
            <p>
              <a
                href="https://en.wikipedia.org/wiki/Main_Page"
                className="nav-link"
                style={{ margin: "10px", whiteSpace: "nowrap" }}
              >
                Digital Citizenship
                <br />
                Principles
              </a>
            </p>
            <p>
              <a
                href="https://en.wikipedia.org/wiki/Main_Page"
                className="nav-link"
              >
                <button
                  style={{
                    color: "white",
                    backgroundColor: "darkOrange",
                    borderRadius: "20px",
                    padding: "1px 20px",
                    height: "30px",
                    fontWeight: "lighter",
                    margin: "10px",
                    whiteSpace: "nowrap",
                    border: "none",
                  }}
                >
                  Contact ISF
                </button>
              </a>
            </p>
            <p>
              <input
                placeholder="search this site...      🔍"
                style={{
                  marginRight: "20px",
                  height: "40px",
                  borderRadius: "5px",
                  border: "1px solid gray",
                  padding: "5px",
                }}
              />
            </p>
            <span style={{ margin: "20px" }}>العربية</span>
          </div>
          
          {/* Mobile dropdown menu - only visible when toggled on mobile */}
          {isMobile && isMenuOpen && (
            <div 
              style={{
                position: "fixed",
                top: "80px",
                left: 0,
                right: 0,
                backgroundColor: "#282c34",
                display: "flex",
                flexDirection: "column",
                padding: "20px",
                zIndex: 1999,
                boxShadow: "0 5px 15px rgba(0,0,0,0.3)"
              }}
            >
              <a href="https://en.wikipedia.org/wiki/Main_Page" style={{color: "white", padding: "10px 0", textDecoration: "none", textAlign: "center", borderBottom: "1px solid rgba(255,255,255,0.2)"}}>About</a>
              <a href="https://en.wikipedia.org/wiki/Main_Page" style={{color: "white", padding: "10px 0", textDecoration: "none", textAlign: "center", borderBottom: "1px solid rgba(255,255,255,0.2)"}}>Resources</a>
              <a href="https://en.wikipedia.org/wiki/Main_Page" style={{color: "white", padding: "10px 0", textDecoration: "none", textAlign: "center", borderBottom: "1px solid rgba(255,255,255,0.2)"}}>Digital Citizenship Principles</a>
              <a href="https://en.wikipedia.org/wiki/Main_Page" style={{textAlign: "center", margin: "10px 0"}}>
                <button
                  style={{
                    color: "white",
                    backgroundColor: "darkOrange",
                    borderRadius: "20px",
                    padding: "10px 20px",
                    border: "none",
                    width: "80%",
                  }}
                >
                  Contact ISF
                </button>
              </a>
              <input
                placeholder="search this site...      🔍"
                style={{
                  margin: "10px auto",
                  height: "40px",
                  borderRadius: "5px",
                  border: "1px solid gray",
                  padding: "5px", 
                  width: "80%"
                }}
              />
              <span style={{ margin: "10px auto", color: "white", textAlign: "center" }}>العربية</span>
            </div>
          )}
        </div>
      </div>
    </>
  );
}

export default TopBar;
